import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';
import { SDSAutocompleteServiceInterface, SDSHiercarchicalServiceResult } from '@gsa-sam/components';
import { map } from 'rxjs/operators';

import { SampleAutocompleteData } from './autocomplete-sample.data';


@Injectable()
export class AutocompleteSampleDataService implements SDSAutocompleteServiceInterface {

    private loadedData;
    constructor() {
        this.loadedData = SampleAutocompleteData;
    }

    getDataByText(currentItems: number, searchValue?: string): Observable<SDSHiercarchicalServiceResult> {
        let itemIncrease = 25;
        let data = of(this.loadedData);
        let itemsOb: Observable<Object[]>;

        if (searchValue) {
            itemsOb = data.pipe(map(items => items.filter(itm =>
                (itm.name.indexOf(searchValue) !== -1 ||
                    itm.subtext.indexOf(searchValue) !== -1
                ))));
        } else {
            itemsOb = data;
        }

        let items: object[];
        itemsOb.subscribe(
            (result) => {
                items = result;
            }
        );
        let totalItemCount = items.length;

        let maxSectionPosition = currentItems + itemIncrease;
        if (maxSectionPosition > totalItemCount) {
            maxSectionPosition = totalItemCount;
        }
        let selectedtems = items.slice(currentItems, maxSectionPosition);

        let returnItem = {
            items: selectedtems,
            totalItems: totalItemCount
        };
        return of(returnItem);

    }
}

import { Injectable } from '@angular/core';
import {
  SDSAutocompleteServiceInterface,
  SDSHiercarchicalServiceResult,
} from '@gsa-sam/components';
import { Observable, of } from 'rxjs';
import { map } from 'rxjs/operators';
import { AutocompleteData } from './autocomplete.data';

@Injectable()
export class AutocompleteService implements SDSAutocompleteServiceInterface {
  private _data = AutocompleteData;

  getDataByText(
    currentItems: number,
    searchValue?: string
  ): Observable<SDSHiercarchicalServiceResult> {
    const itemIncrease = 25;
    const data = of(this._data);
    let items$: Observable<Object[]>;

    if (searchValue) {
      items$ = data.pipe(
        map((items) =>
          items.filter(
            (item) =>
              item.name.indexOf(searchValue) !== -1 ||
              item.subtext.indexOf(searchValue) !== -1
          )
        )
      );
    } else {
      items$ = data;
    }

    let items: object[];
    items$.subscribe((result) => {
      items = result;
    });
    const totalItemCount = items.length;

    let maxSectionPosition = currentItems + itemIncrease;
    if (maxSectionPosition > totalItemCount) {
      maxSectionPosition = totalItemCount;
    }
    const subItemsitems = items.slice(currentItems, maxSectionPosition);

    const returnItem = {
      items: subItemsitems,
      totalItems: totalItemCount,
    };
    return of(returnItem);
  }
}

import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';
import { registrationData } from './search-data';
import { delay } from 'rxjs/operators';
import {
  SearchParameters,
  SearchResult,
} from '../model/search-list-layout.model';
@Injectable({ providedIn: 'root' })
export class DataService {
  private data: any[];
  public getData(search: SearchParameters): Observable<SearchResult> {
    this.data = registrationData._embedded.results;
    if (this.data) {
      if (search.filter) {
        let filterText = '';
        if (search.filter.keyword && search.filter.keyword.keywordTags) {
          filterText = search.filter.keyword.keywordTags[0].text;
        } else if (
          search.filter.keyword &&
          search.filter.keyword.keywordTextarea
        ) {
          filterText = search.filter.keyword.keywordTextarea;
        }
        if (search.filter.keyword || search.filter.location) {
          const toReturn = [];
          for (let i = 0; i < this.data.length; i++) {
            const item = this.data[i];
            if (
              search.filter.keyword &&
              item.title.toLowerCase().indexOf(filterText.toLowerCase()) !== -1
            ) {
              toReturn.push(item);
            } else if (search.filter.location) {
              const location = search.filter.location;

              if (
                location.country &&
                item.address.country &&
                item.address.country
                  .toLowerCase()
                  .indexOf(location.country.toLowerCase()) > -1
              ) {
                toReturn.push(item);
              } else if (
                location.state &&
                location.state.length &&
                item.address.state &&
                location.state.find(
                  (state) =>
                    item.address.state
                      .toLowerCase()
                      .indexOf(state.id.toLowerCase()) > -1
                )
              ) {
                toReturn.push(item);
              } else if (
                location.city &&
                item.address.city &&
                item.address.city
                  .toLowerCase()
                  .indexOf(location.city.toLowerCase()) > -1
              ) {
                toReturn.push(item);
              } else if (
                location.zipCode &&
                item.address.zip &&
                item.address.zip
                  .toLowerCase()
                  .indexOf(location.city.toLowerCase()) > -1
              ) {
                toReturn.push(item);
              }
            }
          }
          this.data = toReturn;
        }
      }
      const start =
        search.page.pageNumber * search.page.pageSize - search.page.pageSize;
      const end = start + search.page.pageSize;
      return of({
        items: this.data.slice(start, end),
        totalItems: this.data.length,
      }).pipe(delay(2000));
    } else {
      return of({
        items: [],
        totalItems: 0,
      });
    }
  }
}

