import {
  Component,
  Output,
  EventEmitter,
  Input,
  OnInit
} from '@angular/core';
import { INavigationLink, NavigationMode, SearchSettings, Selectable } from '@gsa-sam/components';
import { Router } from '@angular/router';


@Component({
  selector: 'sds-subheader-wrapper',
  templateUrl: 'sds-subheader-wrapper.component.html'
})
export class SdsSubheaderWrapperComponent implements OnInit {


  constructor(private router: Router) { }

  @Input() backbuttonBehavior: INavigationLink;

  @Input() title: string;

  @Input() mode: SubHeaderWrapperMode;

  @Input() tabs: TabModel[];

  @Input() searchEnabled: boolean = false;

  @Output() action = new EventEmitter<string>();

  @Input() searchPlaceholderText: string;

  @Input() searchDropDownItems: SerachDropDownItem[];

  searchModel = {};

  HeaderMode = SubHeaderWrapperMode;

  menu = {
    trigger: {
      type: 'plain', // plain | primary
      shadow: true
    },
    actions: []
  };

  searchSettings: SearchSettings = {
    placeholder: '',
    parentSelector: '.sds-subheader__content',
    inputClass:
      'width-card-lg widescreen:width-mobile display-none desktop-lg:display-inline-block',
    size: 'small',
    ariaLabel: 'Search',
    dropdown: {}


  };



  searchSubmit(model) {
    this.action.emit(model);
  }

  public backClick(): void {
    if (!this.backbuttonBehavior) {
      window.history.back();
    } else {
      switch (this.backbuttonBehavior.mode) {
        case NavigationMode.INTERNAL:
          this.router.navigate([this.backbuttonBehavior.route]);
          break;
        case NavigationMode.EXTERNAL:
          window.location.href = this.backbuttonBehavior.route;
          break;
        default:
          window.history.back();
      }
    }
  }


   ngOnInit() {

    if (this.searchPlaceholderText) {
      this.searchSettings.placeholder = this.searchPlaceholderText;
    }

    if (this.searchDropDownItems) {
      this.searchSettings.dropdown =
      {
        id: 'searchOptions',
        placeholder: '-Select-',
        options: this.searchDropDownItems,
        inverse: false,
      };
    }


  }
}

export enum SubHeaderWrapperMode {
  CUSTOM,
  //Accept and Reject buttons
  REQUEST,//(Accept/Reject),

  SUBMIT,//(Submit/EDIT)
  //
  SEARCH,
  //
  TAB
}

export class TabModel implements Selectable {
  text: string;
  id: string;
  selected?: boolean;
}

export class SerachDropDownItem {
  label: string;
  value: string;
}

import { Component, EventEmitter, Input, Output } from '@angular/core';
import { Alert } from './model/alert.model';

@Component({
  selector: 'sds-system-alert',
  templateUrl: './system-alert.component.html',
  styleUrls: ['./system-alert.component.scss']
})
export class SdsSystemAlertComponent {

  /** List of alerts to display. When the list contains only one item, the description of the alert will also
   * be displayed. Description text may contain html
   */
  @Input() alerts: Alert[];

  @Output() seeAllAlerts = new EventEmitter();

  @Output() detailsClicked = new EventEmitter<Alert>();

  @Output() alertDismiss = new EventEmitter<Alert>();

  constructor() { }

  /**
   * Removes the alert from input alerts array
   * @param index - index of the alert in array to remove
   */
  onAlertClose(index: number) {
    const dismissedAlert = this.alerts[index];
    this.alerts.splice(index, 1);
    this.alertDismiss.emit(dismissedAlert);
  }

  /**
   * Fired when 'See All Alerts' button is clicked. Emits the seeAllAlerts event
   */
  onSeeAllAlertsClicked() {
    this.seeAllAlerts.emit();
  }

  /**
   * Fired when 'Show Details' for an alert is clicked. Emits the detailsClicked event
   * with the alert whose 'Show Details' link was clicked and toggles description view for
   * the alert
   * @param alert 
   */
  onShowDetailsClicked(alert: Alert) {
    alert.displayDescription = !alert.displayDescription;
    this.detailsClicked.emit(alert);
  }

  /** On mobile view - hide/display list of alerts based on toggle button */
  onToggleAlertsClicked(alertsContent: HTMLElement) {
    const isHidden = alertsContent.classList.contains('display-none');
    if (isHidden) {
      alertsContent.classList.remove('display-none');
    } else {
      alertsContent.classList.add('display-none');
    }
  }
}

